define('incTower/cursor',['incTower/core', 'lib/knockout'], function (incTower, ko) {
    'use strict';
    //This is a cursor object used for keeping track of building locations, spells etc.
    function Cursor(type, param, action, onMove) {
        this.type = type;
        this.param = param;
        var game = incTower.game;
        this.indicator = incTower.game.add.graphics(0,0);
        if (type === 'buy' || type === 'sell' || type === 'action') {
            //incTower.currentlySelectedIndicator.lineStyle(2, 0x66cc00, 3);
            this.indicator.beginFill(0x3333FF, 0.5);
            this.indicator.drawRect(0,0,32,32);
        }
        if (type === 'spell') {
            this.indicator.beginFill(0x760076, 0.5);
            this.indicator.drawCircle(0,0,incTower.spellAttributes[param].diameter);
        }
        this.indicator.x = incTower.game.input.x;
        this.indicator.y = incTower.game.input.y;
        this.action = action;
        this.onMove = onMove;
    }
    incTower.cursor = ko.observable(false);
    incTower.clearCursor = function () {
        if (incTower.cursor() !== false) {
            if (incTower.cursor().indicator) {
                incTower.cursor().indicator.destroy();
            }
            if (incTower.cursor().textIndicator) {
                incTower.cursor().textIndicator.destroy();
            }
            if (incTower.pathProspectiveGraphic !== undefined) {
                incTower.pathProspectiveGraphic.clear();
            }
        }
        incTower.cursor(false);
    };
    incTower.cursor.subscribe(function (oldValue) {
        if (oldValue !== false && oldValue.indicator) {
            oldValue.indicator.destroy();
        }
        if (oldValue !== false && oldValue.textIndicator) {
            oldValue.textIndicator.destroy();
        }

    }, null, 'beforeChange');


    return Cursor;

});

define('incTower/actions',['incTower/core', 'lib/knockout', 'lib/break_infinity', 'incTower/path', 'incTower/cursor', 'lib/lodash'], function (incTower, ko, Decimal, pathModule, Cursor, _) {
    'use strict';
    var tileSquare = 32;
    incTower.availableActions = ko.observableArray([]);
    incTower.actionAttributes = {
        template: {
            describe: function () {
                return 'Spend gold to scrap a tower to gain blueprint points for towers of that type. Blueprint points increase the starting damage for the given tower type by 1 and increase starting gold cost by 5 per point.';
            },
            keybind: 'B',
            perform: function (pointer) {
                var tileX = Math.floor(pointer.worldX / tileSquare);
                var tileY = Math.floor(pointer.worldY / tileSquare);
                console.log(tileX);
                if (tileX > 24 || tileY > 18) {
                    return false;
                }
                if (tileX === 0 && tileY === 0) {
                    return false;
                }
                if (!pathModule.tileForbidden[tileX][tileY]()) {
                    return false;
                }
                //Don't allow templating at one tower
                if (incTower.numTowers() === 1) {
                    return false;
                }
                var targetTower = pathModule.tileForbidden[tileX][tileY]();
                var blueprints = targetTower.totalDamage().sqrt().times(1 + 0.05 * incTower.getEffectiveSkillLevel('refinedBlueprints'));
                incTower.incrementObservable(incTower.towerBlueprints[targetTower.towerType], blueprints);
                incTower.destroyTower(targetTower);

            },
            onMove: function (x, y) {
                var tileX = Math.floor(x / tileSquare);
                var tileY = Math.floor(y / tileSquare);
                //console.log([x,y]);
                var valid = true;
                if (valid && (tileX > 24 || tileY > 18)) {
                    valid = false;
                }
                if (tileX === 0 && tileY === 0) {
                    valid = false;
                }
                if (!pathModule.tileForbidden[tileX][tileY]()) {
                    valid = false;
                }
                if (valid !== this.currentIndicatorStatus || tileX !== this.lastTileX || tileY !== this.lastTileY) {
                    this.indicator.clear();

                    if (valid) {
                        //this.indicator.beginFill(0x33FF33, 0.5);
                        this.indicator.beginFill(0x3333FF, 0.5);
                        if (!this.textIndicator) {
                            this.textIndicator = incTower.game.add.text(0, 0, "", {
                                font: "14px Arial",
                                stroke: 'white',
                                strokeThickness: 1,
                                fontWeight: "bold",
                                fill: '#0000EE',
                                align: "center"
                            });
                        }
                        this.textIndicator.alpha = 1;
                        var tower = pathModule.tileForbidden[tileX][tileY]()
                        var blueprints = tower.totalDamage().sqrt().times(1 + 0.05 * incTower.getEffectiveSkillLevel('refinedBlueprints'));
                        var totalBlueprints = blueprints.plus(incTower.towerAttributes[tower.towerType].blueprintPoints());
                        this.textIndicator.text = '+' + incTower.humanizeNumber(blueprints) + ' (' + incTower.humanizeNumber(totalBlueprints) + ')';

                    } else {
                        if (this.textIndicator !== undefined) {
                            this.textIndicator.alpha = 0;
                        }
                        this.indicator.beginFill(0x760076, 0.5);
                    }
                    this.indicator.drawRect(0, 0, 32, 32);
                    this.currentIndicatorStatus = valid;
                    this.lastTileX = tileX;
                    this.lastTileY = tileY;
                }

            }
        }
    };
    incTower.castAction = function (action) {
        var curCursor = incTower.cursor();
        //If our cursor already holds this spell then cancel it.
        if (curCursor !== false && curCursor.type === 'action' && curCursor.param === action) {
            incTower.clearCursor();
            return;
        }
        
        incTower.cursor(new Cursor('action', action, 
            function (pointer) {
                incTower.actionAttributes[action].perform(pointer, action);
            },
            incTower.actionAttributes[action].onMove
        ));
    };
});

