            'normalEnemyPacks',
            'cursor',
            'deadBullets',
            'frame',
            'enemyTypes',
            'remainingEnemies',
            'towerAttributes',
            'floatingTexts',
            'availableTowers',
            'bossPowers',
            'numSuffixes',
            'skillAttributes',
            'startingSkills',
            'UIselectedSkill',
            'pathGraphic',
            'spellAttributes',
            'towerMaxDamage',
            'buffs',
            'disabledFrames',
